	render() { return ( <div className="App"> { list.map(function(item) { return ( <div> <span> <a href={item.url}>{item.title}</a> </span> <span>{item.author}</span> <span>{item.num_comments}</span> <span>{item.points}</span> </div> ); })} </div>
	);
	}
}
export default App;
